		String databaseUrl = String.format(DATABASE_URL, mongoContainer.getContainerIpAddress(), mongoContainer.getFirstMappedPort());
		String database = new URL(databaseUrl.replace("mongodb://", "https://")).getPath().substring(1);
		TimeSeriesArrays timeSeriesArrays = TestUtil.getDefaultTimeSeriesArrays();

		MongoDbArchiveDatabasePlugin mongoDbArchiveDatabasePlugin = MongoDbArchiveDatabasePlugin.create();
		mongoDbArchiveDatabasePlugin.setUnitConverter(new TestUtil.ArchiveDatabaseUnitConverterTestImplementation());
		mongoDbArchiveDatabasePlugin.setTimeConverter(new TestUtil.ArchiveDatabaseTimeConverterTestImplementation());
		mongoDbArchiveDatabasePlugin.setArchiveDatabaseUrl(databaseUrl);
		mongoDbArchiveDatabasePlugin.setProperties(new Properties.Builder().addString("database", database).build());
		mongoDbArchiveDatabasePlugin.insertSimulatedHistoricalTimeSeries(timeSeriesArrays, "areaId", "sourceId");

		MongoClient mongoClient = MongoClients.create(databaseUrl);
		int index = 0;
		List<Document> documents = StreamSupport.stream(mongoClient.getDatabase(database).getCollection("SimulatedHistoricalScalarTimeSeries").find().sort(new Document("moduleInstanceId", 1).append("locationId", 1).append("parameterId", 1).append("qualifierId", 1).append("encodedTimeStepId", 1).append("startTime", 1)).spliterator(), false).collect(Collectors.toList());
		assertEquals(expected.length, documents.size());
		for (Document d : documents) {
			assertEquals(d.get("metaData", Document.class).getDate("archiveTime"), d.get("metaData", Document.class).getDate("modifiedTime"));
			d.get("metaData", Document.class).remove("archiveTime");
			d.get("metaData", Document.class).remove("modifiedTime");
			d.remove("_id");
			assertEquals(expected[index++].toJson(), d.toJson());
		}

		mongoDbArchiveDatabasePlugin.insertSimulatedHistoricalTimeSeries(timeSeriesArrays, "areaId", "sourceId");

		index = 0;
		documents = StreamSupport.stream(mongoClient.getDatabase(database).getCollection("SimulatedHistoricalScalarTimeSeries").find().sort(Sorts.ascending("moduleInstanceId", "locationId", "parameterId", "qualifierId", "encodedTimeStepId", "startTime")).spliterator(), false).collect(Collectors.toList());
		assertEquals(expected.length, documents.size());
		for (Document d : documents) {
			assertNotSame(d.get("metaData", Document.class).getDate("archiveTime"), d.get("metaData", Document.class).getDate("modifiedTime"));
			d.get("metaData", Document.class).remove("archiveTime");
			d.get("metaData", Document.class).remove("modifiedTime");
			d.remove("_id");
			assertEquals(expected[index++].toJson(), d.toJson());
		}
